def main():
    instructionsString = """



"""

    instructions = instructionsString.split('\n')

    keypad = [[(i * 3) + (j + 1) for i in range(3)] for j in range(3)]

    current_key = [1, 1]

    print(keypad[current_key[0]][current_key[1]])

    def find_next_key(direction):
        if direction == "U":
            if current_key[1] == 0:
                pass
            else:
                current_key[1] -= 1
        elif direction == "R":
            if current_key[0] == 2:
                pass
            else:
                current_key[0] += 1
        elif direction == "D":
            if current_key[1] == 2:
                pass
            else:
                current_key[1] += 1
        elif direction == "L":
            if current_key[0] == 0:
                pass
            else:
                current_key[0] -= 1

    print("Bathroom keycode is: ", end="")

    for instruction in instructions:
        for direction in instruction:
            find_next_key(direction)
        print(keypad[current_key[0]][current_key[1]], end="")

main()
